import React from 'react';
import { ParallaxLayer } from 'react-spring/renderprops-addons';

const Projects = ({ offset, speed }) => {
    return (
        <div>
            <ParallaxLayer offset={offset} speed={speed}>
                <div style={{color: 'white'}}>
                    <h2>Projetos</h2>
                </div>
            </ParallaxLayer>
        </div>
    );
}

export default Projects;
